        Color3.new(1, 1, 1), -- ç™½è‰²
        Color3.new(0, 0, 0), -- é»‘è‰²
    }
    local rainbowIndex = math.floor((LastIteration % 6) + 1)
    LBL.TextColor3 = rainbowColors[rainbowIndex]
end

Start = tick()

Heartbeat:Connect(HeartbeatUpdate)

